import React from 'react';
import { CardItem } from '../main';

export default function ListCardItem({citems}) {

    const [cat, setCat] = React.useState();
    const cats = ['Привелегии, Кейсы, Вещи, Валюта']

    return (
        <div>
            <div class="category">
                <div class="category__item-use" onClick><span>Привелегии</span></div>
                <div class="category__item"><span>Кейсы</span></div>
                <div class="category__item"><span>Вещи</span></div>
                <div class="category__item"><span>Валюта</span></div>
            </div>

            <div class="cards">
                {citems.map(citem => <CardItem citem={citem} /> )}
            </div>
        </div>
    )
};
